import './App.css'
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { First } from "./Components/first/First";
import { About } from './Components/second/About';
import { Services } from './Components/third/Services';
import { NavBar } from './Components/first/navBar/NavBar';
import { Fourth } from './Components/fourth/Fourth';
import { Portfolio } from './Components/fifth/Portfolio';
import { TwoPeople } from './Components/six/TwoPeople';
import { Last } from './Components/last/Last';
import { useRef } from "react";


function App() {
  const About = useRef()

  const moveDown = () =>{
      About.current.scrollIntoView({behavior:'smooth' , block:'start'})
  }

  return (
    <>

      <BrowserRouter>
        <NavBar />
        <Routes>
          <Route path="/" element={<First />} />
        </Routes>
      </BrowserRouter>
      <About ref={About} />
      <Services />
      <Fourth />
      <Portfolio />
      <TwoPeople />
      <Last />
    </>
  );
}

export default App;
